#======================================================================
# Global Options apply to all runs
#======================================================================
#
# For just a report generated without a raw file or any runs required
# Do a "runspec --reportonly"   (also --action=report or --fakereport)
#
# Just set up the build or run directories, use --buildsetup or --setup
# on the runspec command

# Sets nobuild as the default - you will need -D to force a compile
#nobuild         = 1

# -D forces a build (recompile)
# -N prohibits a build (recompile)

#build_in_build_dir	= 1
action    	        = validate
tune             	= base,peak
iterations      	= 3
output_format   	= txt,asc,cfg,csv,html,pdf
basepeak        	= 0
reportable      	= 1
ignore_errors   	= 0
mean_anyway    		= 1
allow_label_override = 1
label           	= P9_ZZ
size            	= test,train,ref
parallel_setup_type = fork
bench_post_setup 	= sync
post_setup 		    = sync
parallel_test 		=  1
teeout          	= no
check_md5       	= 1
strict_rundir_verify 	= 1
backup_config   	= 0

# These are the envionment variables that are set before the run
preenv 			= 1
env_vars        	= 1

%ifdef %{fdpr}
preENV_LD_LIBRARY_PATH=$LD_LIBRARY_PATH:/opt/FDPR
%endif
preENV_LD_PRELOAD=/opt/at11.0/lib64/libhugetlbfs.so
preENV_TCMALLOC_MEMFS_MALLOC_PATH=/dev/hugepages/
preENV_MALLOC_MMAP_MAX_=0
preENV_HUGETLB_VERBOSE=0
preENV_HUGETLB_MORECORE=yes
preENV_XLSMPOPTS=spins=0:yields=0:schedule=STATIC:stack=8000000
preENV_XLFRTEOPTS=intrinthds=1

notes_os_000	= Stack size is set to unlimited
notes_os_001	= ulimit -s unlimited
notes_os_002	= Number of huge pages alloted are 11520
notes_os_015    = echo 11520 > /proc/sys/vm/nr_hugepages
notes_os_020	= drop cache is used before invoking runcpu command
notes_os_025	= sync; echo 3 > /proc/sys/vm/drop_caches


# verbose -> -v
#verbose	= 1 to 99, 5 is default, 91 is good for debugging
#verbose	= 1

# Set up how parallel to do the compiles
%ifdef %{make_j}
makeflags       = -j%{make_j}
%endif

#--prevent log file lines that are too long for vi
#  But must be long enough for port_progress to get data
log_line_width  = 1024

# Point to where the usr/compiler/OS Flags file is
#flagsurl000     = http://www.spec.org/cpu2006/flags/IBM-XL.V13La.xml
#flagsurl001     = http://www.spec.org/cpu2006/flags/IBM-Linux-V7.xml


flagsurl1       = %{install_path}/config/IBM_XL_Linux_1317_flags.xml
flagsurl2       = %{install_path}/config/IBM_Linux_9009_S.xml


CC_VERSION_OPTION       = -qversion=verbose
CXX_VERSION_OPTION      = -qversion=verbose
FC_VERSION_OPTION       = -qversion=verbose

CC_PATH         = /opt/ibm/xlC/16.1/bin
CXX_PATH        = /opt/ibm/xlC/16.1/bin
XLF_PATH        = /opt/ibm/xlf/16.1/bin

#===============================================================================
# How the compilers are called
